import api from './api'

function GetForecastList(street, city, state, zipcode, setSuccess, setError){
    api.get("/forecast/address?street=4600+Silver+Hill+Rd&city=%20Washington&state=DC&zipcode=20233")
    .then(res => {
        setSuccess(res.data)
    })
    .catch(err => {
        setError(err)
    })
}

export default GetForecastList;
